column8:
格安工具のタツマックスメガTRUSC(トラスコ)商品「頭のつぶれたネジってどうやって外すの！？」
<img src="http://image.rakuten.co.jp/tatsumax/cabinet/02710737/keisoku/03059941/img60932815.jpg"><br>
<img src="http://image.rakuten.co.jp/tatsumax/cabinet/02710737/keisoku/03059941/img60932798.jpg"><br>
【特長】<br><br>●切断刃を装着しφ1.2mmの銅線も楽々カットできます。<br>●潰れたねじ、サビたねじ、固着ねじをガッチリつかんで外します。<br>●奥まった所のねじも廻せるスリムな先端です。<br>●環境に配慮したエコ樹脂デザイングリップです。<br>●先端の新ザウルス溝でM4までのトラスねじがつかめます。<br>●ばねを装着し、連続作業でも疲れにくいです。<br>●グリップの材質はエラストマーです。<br>
【仕様】<br><br>●全長(mm):160<br>●グリップ幅(mm):54<br>●先端幅(mm):17.5<br>●厚み(mm):8.5<br>●先端長さ(mm):28<br>
【備考】<br><br>●ばね付<br>●適応トラスねじ/先端くわえ部:M2～M4<br>●適応ナベねじM1.6～M5、本体くわえ部:M3～M5<br>●刃部硬度:HRC56±2<br>
【JANコード】<br>4989833039585<br>
【生産国】<br>日本<br>
【質量】<br>130G<br>
【ブランド】<br>エンジニア<br>
【メーカー】<br>（株）エンジニア<br><img src="http://image.rakuten.co.jp/tatsumax/cabinet/dum724.gif" width="724" height="5">

